package entity

import (
	"fmt"
	"testing"

	"github.com/asaskevich/govalidator"
	. "github.com/onsi/gomega"
)

func TestPictureCorrect(t *testing.T) {
	g := NewGomegaWithT(t)

	t.Run("Check format Picture", func(t *testing.T) {
		picture := Picture{
			Picture:  "data:image/png;base64,",
			Title:    "Treadmill",
			Describe: "A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place.It provide a convenient and controlled environment for cardiovascular workouts.",
		}

		// Validate the picture using govalidator
		ok, err := govalidator.ValidateStruct(picture)

		//เช็คว่ามันเป็นค่าจริงไหม
		g.Expect(ok).To(BeTrue())

		//เช็คว่ามันว่างไหม
		g.Expect(err).To((BeNil()))

		fmt.Println(err)
	})
}

func TestPicture(t *testing.T) {
	g := NewGomegaWithT(t)

	t.Run("Check picture not blank ", func(t *testing.T) {

		picture := Picture{

			Picture:  "",
			Title:    "Treadmill",
			Describe: "A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place. It provide a convenient and controlled environment for cardiovascular workouts.",
		}
		//ตรวจสอบด้วย govalidator
		ok, err := govalidator.ValidateStruct(picture)
		g.Expect(ok).ToNot(BeTrue())
		g.Expect(err).ToNot(BeNil())
		g.Expect(err.Error()).To(Equal("Please select the picture."))
	})

	t.Run("Check title not blank ", func(t *testing.T) {

		picture := Picture{

			Picture:  "data:image/png;base64,",
			Title:    "",
			Describe: "A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place. It provide a convenient and controlled environment for cardiovascular workouts.",
		}
		//ตรวจสอบด้วย govalidator
		ok, err := govalidator.ValidateStruct(picture)
		g.Expect(ok).ToNot(BeTrue())
		g.Expect(err).ToNot(BeNil())
		g.Expect(err.Error()).To(Equal("Please fill the equipment name."))
	})

	t.Run("Check describe not blank ", func(t *testing.T) {

		picture := Picture{

			Picture:  "data:image/png;base64,",
			Title:    "Treadmill",
			Describe: "",
		}
		//ตรวจสอบด้วย govalidator
		ok, err := govalidator.ValidateStruct(picture)
		g.Expect(ok).ToNot(BeTrue())
		g.Expect(err).ToNot(BeNil())
		g.Expect(err.Error()).To(Equal("Please fill any caption about the equipment that you added."))
	})

	t.Run("Check describe max 500 ", func(t *testing.T) {

		picture := Picture{

			Picture:  "data:image/png;base64,",
			Title:    "Treadmill",
			Describe: "A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place. It provide a convenient and controlled environment for cardiovascular workouts.A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place. It provide a convenient and controlled environment for cardiovascular workouts.A treadmill is a piece of exercise equipment designed for walking, jogging, or running while staying in one place. It provide a convenient and controlled environment for cardiovascular workouts.",
		}
		//ตรวจสอบด้วย govalidator
		ok, err := govalidator.ValidateStruct(picture)
		g.Expect(ok).ToNot(BeTrue())
		g.Expect(err).ToNot(BeNil())
		g.Expect(err.Error()).To(Equal("It is too many characters."))
	})
}
